import React from 'react'
import AppLayout from '../components/AppLayout'

function ticketing() {
    return (
        <AppLayout>
            <div>
                <div className="movie-theaters">영화관</div>
                <div className="movie-theaters">극장</div>
            </div>
        </AppLayout>
    )
}

export default ticketing
